import { Button } from "@material-ui/core";
import {
  EComponentTitle,
  TComponent,
  TComponentProps,
  TProp
} from "~/interfaces/material_components";
import { mapToComponentProps } from "~/utils";
import { ButtonProps, EPropName } from "./interface";
import props from "./props";

const hogehoge = (props: TProp[]): TComponentProps => {
  return props.reduce(
    (accumulator: Record<string, any>, currentValue: TProp) => {
      if (currentValue.name === "children") return accumulator;
      accumulator[currentValue.name] = currentValue.default;
      return accumulator;
    },
    {}
  );
};

const hoge = (props: ButtonProps) => {
  Object.keys(props).reduce(
    (
      accumulator: Record<keyof ButtonProps, any>,
      propName: keyof ButtonProps
    ) => {
      if (propName === EPropName.CLASSES || propName === EPropName.COMPONENT)
        return accumulator;
      accumulator[propName] = props[propName].value;
      return accumulator;
    },
    {}
  );
};

const component: TComponent = {
  title: EComponentTitle.BUTTON,
  jsx: <Button {...mapToComponentProps(props)}>ボタン</Button>,
  props
};

export default component;
